def predict(triples: list[Triple]) -> str:
    airport = None
    location = None
    country = None
    for triple in triples:
        if triple.predicate == "cityServed":
            airport = triple.subject
            location = triple.object
        elif triple.predicate == "location":
            location = triple.object
        elif triple.predicate == "country":
            country = triple.object
        elif triple.predicate == "isPartOf":
            location += f", which is part of {triple.object}"

    if airport and location and country:
        return f"{airport} is located in {location}, {country}."
    elif airport and location:
        return f"{airport} is located in {location}."
    elif airport:
        return f"{airport}."
    else:
        return "Unknown."

